function App (){

  const [data,setData] = useEffect([{}])
  useEffect(()=>{
      fetch('/mem'),then(
          res=>res.json()
      ).then(
        data=>{
          setData(data)
          console.log(data)
        }
      )
  })
        return (
          <div>
              Hello world
          </div>

        )
}

export default App;
